import React from 'react'
import { Menu } from 'antd';

function Navbar() {
    return (
            <Menu style={menuStyle} width= "200px" theme="dark"mode="horizontal" defaultSelectedKeys={['1']}>
                <Menu.Item style={itemStyle}key='1'>Home</Menu.Item>
                <Menu.Item style={itemStyle} key='2'>About Us</Menu.Item>
                <Menu.Item style={itemStyle} key='3'>Contact Us</Menu.Item>
            </Menu>
    )
}

let menuStyle={
    width: '30%',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center'
}

let itemStyle ={
    color: 'white',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    width: '33.33%',
    fontSize: '25px',
    
}

export default Navbar;
